    false,nt"url": null,nt"notes": "This narrative report for Prime Hook National
    Wildlife Refuge outlines Refuge accomplishments during the 1980 calendar year. The
    report begins with an introduction to the Refuge and information about climatic
    and habitat conditions, land acquisition, system status, and funding. The construction
    and maintenance section discusses construction, maintenance, and wildfires. Habitat
    management is covered; croplands, grasslands, wetlands, and forestlands are discussed.
    The wildlife section of the report discusses endangered and threatened species,
    migratory birds, and mammals. Interpretation and recreation activities are outlined;
    topics include information and interpretation, recreation, fishing, and law enforcement.
    Field investigations, cooperative programs, items of interest, and safety are discussed.",nt"owner_org":
